const e=JSON.parse('{"key":"v-73df7fa8","path":"/lc3169.html","title":"3169. 无需开会的工作日","lang":"en-US","frontmatter":{"tag":"sort"},"headers":[],"git":{"createdTime":1731068889000,"updatedTime":1731068889000,"contributors":[{"name":"HouShengming","email":"18865290907@163.com","commits":1}]},"readingTime":{"minutes":1.38,"words":414},"filePathRelative":"lc3169.md","localizedDate":"November 8, 2024","excerpt":"<h1> 3169. 无需开会的工作日</h1>\\n<p>给你一个正整数 <code>days</code>，表示员工可工作的总天数（从第 <code>1</code> 天开始）。另给你一个二维数组 <code>meetings</code>，长度为 <code>n</code>，其中 <code>meetings[i] = [start_i, end_i]</code> 表示第 <code>i</code> 次会议的开始和结束天数（包含首尾）。</p>\\n<p>返回员工可工作且没有安排会议的天数。</p>\\n<p>注意：会议时间可能会有<strong>重叠</strong>。</p>\\n<p>示例 1：\\n输入：days = 10, meetings = [[5,7],[1,3],[9,10]]\\n输出：2\\n解释：\\n第 4 天和第 8 天没有安排会议。</p>"}');export{e as data};
